import React from 'react'
import PrimarySearchAppBar from "./components/navbar/Navigation";
import LoginForm from "./components/modal/LoginForm";
import LogoutForm from "./components/modal/LogoutForm";
import RegistrationForm from "./components/modal/RegistrationForm";


function App () {
  return (
      <div>
        <PrimarySearchAppBar/>
        <LoginForm/>
        <LogoutForm/>
        <RegistrationForm/>
      </div>

  )
}

export default App
